B.rV=new A.ba(B.KO,["Let's kick things off by sharing your fitness goals and preferences, as well as any health conditions you have. The more details you provide, the better we can tailor your experience!","Don't forget to update the app every day with important info that affects your workout readiness and overall well-being. This includes tracking your menstrual flow, pain levels, mood, anxiety, hydration, energy levels, and readiness to exercise. Your daily inputs help the app's AI adjust your workout plan to match your current state.","Our advanced algorithm will use the information provided to create a personalized workout plan for you. This plan will adapt to your long-term goals and daily inputs, ensuring that you always have a workout that is tailored to your needs. Whether you're feeling low on energy or super strong, our goal is to align your workout with your current place on your personal fitness journey.","With our app, you can track your progress and see how your body responds to workouts, helping you stay motivated and understand your overall health. We're here to guide you towards your goals while considering your unique health needs."],t.li)
